import React from "react";
import { NavLink } from "react-router-dom";
import Web from "../src/image/launcher.svg";
import Common from "./Common";

const Home = () =>{
    return (
        <>
          <Common imgsrc={Web} btntext="JOIN US" link="/contact" text={<h1>Build Your Website With <strong>Technical Abhishek</strong></h1>}
                extras={<><h5>Our Company Provides You To Develop Your Own Dynamic Website </h5>
                    <h6>Here You Can Build Your E-Commerce Website,Blog Website And Many More</h6></>} />
        </>
    )
}

export default Home;







